import React from "react";
import logo from "../img/Pentagram.png"

const barStyles = {
  height: "7%", /* 100% Full-height */
  width: "100%", /* 0 width - change this with JavaScript */
  position: "fixed", /* Stay in place */
  zIndex: "1", /* Stay on top */
  top: "0", /* Stay at the top */
  backgroundColor: "hsl(169, 60%, 60%)", /* purple*/
}

const barItem = {
    display:"inline",
    paddingLeft:"13%",
    paddingRight:"13%"
}


function Navbar(){
    return(
        <div style = {barStyles} className = "navTag">
            <div className = "logo">
            <a href="shop.html"><img src={logo} alt="logo"/></a>
            </div>
            <h3 style = {barItem}>Home</h3>
            <h3 style = {barItem}>Shop</h3>
            <h3 style = {barItem}>About</h3>
        </div>
    );
}

export default Navbar;
